import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
// Importa tu endpoint de registro cuando esté listo
// import { register as registerApi } from "./api/auth";

export default function RegisterPage() {
  const navigate = useNavigate();

  const [fullName, setFullName] = useState("");
  const [email, setEmail] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [acceptTerms, setAcceptTerms] = useState(false);
  const [error, setError] = useState(null);

  async function handleSubmit(e) {
    e.preventDefault();
    setError(null);

    if (password !== confirmPassword) {
      setError("Las contraseñas no coinciden");
      return;
    }

    if (!acceptTerms) {
      setError("Debes aceptar los términos y condiciones");
      return;
    }

    try {
      // TODO: conectar con backend
      // const data = await registerApi({ fullName, email, username, password });

      alert("✅ Cuenta creada correctamente");
      navigate("/login");
    } catch (err) {
      console.error("Error en registro:", err);
      setError("No se pudo completar el registro.");
    }
  }

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <form onSubmit={handleSubmit} className="bg-white p-8 rounded shadow-md w-96">
        <h2 className="text-2xl font-bold mb-6 text-center">Crear cuenta</h2>

        {/* Nombre */}
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-600 mb-1">
            Nombre completo
          </label>
          <input
            type="text"
            placeholder="Ej: Laura Martínez"
            value={fullName}
            onChange={(e) => setFullName(e.target.value)}
            required
            className="w-full border border-gray-300 p-2 rounded focus:outline-none focus:ring-2 focus:ring-blue-400"
          />
        </div>

        {/* Email */}
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-600 mb-1">
            Correo electrónico
          </label>
          <input
            type="email"
            placeholder="tu@email.com"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            className="w-full border border-gray-300 p-2 rounded focus:outline-none focus:ring-2 focus:ring-blue-400"
          />
        </div>

        {/* Usuario */}
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-600 mb-1">
            Usuario
          </label>
          <input
            type="text"
            placeholder="Nombre de usuario"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
            className="w-full border border-gray-300 p-2 rounded focus:outline-none focus:ring-2 focus:ring-blue-400"
          />
        </div>

        {/* Contraseña */}
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-600 mb-1">
            Contraseña
          </label>
          <input
            type="password"
            placeholder="********"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
            className="w-full border border-gray-300 p-2 rounded focus:outline-none focus:ring-2 focus:ring-blue-400"
          />
        </div>

        {/* Repetir contraseña */}
        <div className="mb-4">
          <label className="block text-sm font-medium text-gray-600 mb-1">
            Repetir contraseña
          </label>
          <input
            type="password"
            placeholder="********"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            required
            className="w-full border border-gray-300 p-2 rounded focus:outline-none focus:ring-2 focus:ring-blue-400"
          />
        </div>

        {/* Aceptar términos */}
        <div className="flex items-center gap-2 mb-6 text-sm">
          <input
            type="checkbox"
            required
            className="accent-blue-600"
            checked={acceptTerms}
            onChange={(e) => setAcceptTerms(e.target.checked)}
          />
          <span className="text-gray-600">
            Acepto los{" "}
            <button
              type="button"
              onClick={() => alert("Mostrar términos")}
              className="text-blue-600 hover:underline"
            >
              términos y condiciones
            </button>
          </span>
        </div>

        {/* Botón Registrar */}
        <button
          type="submit"
          className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700 transition font-medium shadow"
        >
          Crear cuenta
        </button>

        {/* Link a login */}
        <p className="text-center text-sm text-gray-600 mt-4">
          ¿Ya tienes una cuenta?{" "}
          <button
            type="button"
            onClick={() => navigate("/login")}
            className="text-blue-600 hover:underline"
          >
            Iniciar sesión
          </button>
        </p>

        {error && (
          <p className="text-red-600 mt-4 text-sm text-center">{error}</p>
        )}
      </form>
    </div>
  );
}
